export default function RestrictedPage({ isLoggedIn, user, Login, Logout }) {
  return isLoggedIn ? (
    <div>
      Bem-vindo{user} <button> {Logout} </button>{" "}
    </div>
  ) : (
    <div>
      <h2>Você não pode acessar essa página</h2>
      <button> {Login} Login </button>
    </div>
  );
}
